<section class="fd-mission" id="mission">

    <div class="fd-mission__container">
      <h2 class="fd-mission__title" aria-label="our mission">
        <span aria-hidden="true">our</span>
        <span aria-hidden="true">mission</span>
      </h2>
      <div class="fd-mission__text">
        <i class="fd-mission__italic">Fundamental Conference is designed to highlight the best of front-end development and design in one place. </i>
        <div class="fd-mission__line"></div>
        <p class="fd-mission__paragraph">We believe everyone should have an intelligent toolkit for building accessible applications through the practice of inclusive design. By celebrating 
            excellence and innovation, we aim to inspire our community to make the
             future of technology a better place for all. </p>
      </div>
    </div>
